for...in循环

for...in循环能用来遍历对象类型，但是for...of只能用来遍历具有Symbol.iterator属性的对象，比如Array、Set、Map等。
var obj = {};

function judgeObj(obj) {
  for(let key in obj) {
    return false
  }
  return true
};

judgeObj(obj); // true


Object.keys(obj)

Object.keys(obj)是Object的构造函数方法，返回obj的键值，它与Symbol.iterator对象的keys是不一样的：
let set = new Set()
set.add(1)
console.log(Object.keys(set))       // []   空数组，无键值信息
console.log(set.keys())       // SetIterator {1}   键值信息

判断是否为空数组
var obj = {}
Object.keys(obj).length === 0; // true
// 或者用值
Object.values(obj).length === 0; // true

二、对象的常用函数

Object.prototype.hasOwnProperty(prop)
判断对象自身属性，而不是原型链继承到的属性。
Object.create(parent, descr) (ES5)
创建新对象，并设置它的原型（parent），和值（descr）。var parent = {hi: 'Hello'};
var o = Object.create(parent, {
  prop: {
      value: 1
  }
});
o.hi; // 'Hello'
// 获得它的原型
Object.getPrototypeOf(parent) === Object.prototype; // true 说明parent的原型是Object.prototype
Object.getPrototypeOf(o); // {hi: "Hello"} // 说明o的原型是{hi: "Hello"}
o.hasOwnProperty('hi'); // false 说明hi是原型上的
o.hasOwnProperty('prop'); // true 说明prop是原型上的自身上的属性。


Object.getPrototypeOf(obj)
获取对象obj的原型。

