类数组
类数组是看起来像数组，实际上不是数组，而是键值为数字的对象，不能使用数组方法的数组，它只有自身定义的length属性是跟数组一样的。
let arguments = {
  // 键值从 0-n
    '0': 'a',
    '1': 'b',
    '2': 'c',
    // 有 length 属性
    length: 3
};

类数组变成数组的几种方式

Array.fromlet arr = Array.from(arguments) // ['a','b','c']


ES5中 Array.prototype.slice.call()function test(a,b,c,d) 
 { 
    var arg = Array.prototype.slice.call(arguments,1); 
    console.log(arg); 
 } 
 test("a","b","c","d"); //b,c,d


es6扩展运算符
扩展运算符只能扩展具有Symbol.iterator属性的类数组，所以自己定义的arguments是不能用扩展运算符直接展开的。

// 错误
let arr = [...arguments]  // error

// 正确，形参是类数组
function a(b,c,d) {
  console.log([...arguments]) // 1,2,3
}
a('1','2','3')

以上三个方法都是只能在键值严格符合数组下标的情况下起作用。

interview/add.html.body:
高阶函数之返回函数的函数
一、类型判断函数
返回函数的函数也是高阶函数。
// 常规实现
function isType(type) {
  return function (obj) {
    return Object.prototype.toString.call(obj) === '[object ' + type + ']'
  }
}
console.log(isType('String'))       // function (obj){}
console.log(isType('String')('123'))    // true

// 箭头函数实现
let isType = type => obj => {
  return Object.prototype.toString.call(obj) === '[object ' + type + ']'
}
console.log(isType('String'))   // obj => {}
console.log(isType('String')('123'))  //true

二、无限累加函数
要实现无限累加的函数，需要知道一个知识点：每次console.log的时候都会调用输出对象的toString方法，下面直接看代码。
function add(a) {
    function sum(b) { // 使用闭包
      console.log(b)
      a = a + b; // 累加
      // 每次都返回 sum 函数
      return sum;
    }
    sum.toString = function() { // 重写toString()方法
      return a;
    }
    return sum; // 返回一个函数
}

console.log(add(1))   // f 1
console.log(add(1)(2))  // 2
                        // f 3
console.log(add(1)(5)) // 5
                        // f 6

这个代码的过程是这样的：

当console.log(add(1))时
先是形参a=1，sum函数不执行，最后returnsum函数，console.log时，调用返回的sum对象的toString方法，返回a。// 形参 a=1
function add(a) {
// 不执行
 function sum(b) { 
   console.log(b)
   a = a + b;
   return sum;
 }
 sum.toString = function() { 
   return a;
 }
// 返回一个函数，add(1)之后变成了 sum
 return sum; 
}


当console.log(add(1)(2))时
add(1)返回了sum函数，且给a赋值1，所以接下来执行sum(2)，打印出b的值2，a累加为3，返回sum函数，最后console.log(sum)自动调用toString()方法打印出3
